  KEY `layersID` (`layers`),
  KEY `sizeID` (`size`),
  KEY `typeID` (`type`),
  KEY `elementID` (`element`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

